(14,	'HP - Omen 15-ce001ne Laptop',	'',	'',	'',	1,	0,	'HP Omen 15 laptop is an epitome of high-end functionality and good looks. \r\n\r\nThis HP Omen 15.6 laptop looks appealing and luxurious in a beautiful black finish.\r\n\r\nThe HP OMEN 15-ce001ne Laptop is equipped with powerful hardware and an aggressive design that lets you conquer any challenge from anywhere.\r\n\r\nIt works on a powerful 7th generation, Intel Core i7-7700 Quad-Core processor that runs all applications smoothly while keeping the system’s power consumption in check.\r\n\r\n\r\nWindows 10\r\n\r\nDo great things confidently with the familiar feel of Windows—only better.5\r\n7th generation Intel® Core™ processors\r\n\r\nPowerful performance easily keeps up with all your multitasking demands, enables new ways to interact with your PC, and delivers enhanced 4K video capabilities.6\r\nFull HD display\r\n\r\nSit back and enjoy crystal-clear visuals and images with the vibrant quality of 2 million pixels. The 1920 x 1080 resolution gives all your digital content a new dimension.7\r\nFull HD IPS display\r\n\r\nEnjoy crystal-clear images from any angle. With 178° wide-viewing angles and a vibrant 1920 x 1080 resolution, you’ll always have a great view of your favorite content.7\r\nHigh-definition display\r\n\r\nSee your digital world in a whole new way. Enjoy movies and photos with the great image quality and high-definition detail of 1 million pixels.\r\nAn exceptionally rich audio experience\r\n\r\nWith HP Dual Speakers, HP Audio Boost, and custom tuning by the experts at Bang & Olufsen, entertainment comes to life with sound you can feel. Awaken your senses with PC audio perfection.\r\nDragon Red back-lit keyboard\r\n\r\nSingle access door\r\n\r\nQuickly access your PC’s internals with the large, single door on the bottom of the laptop. Held on by only a few screws, it’s easily removable for upgrading or maintenance.\r\nOMEN lighting control\r\n\r\nCustomize your battle station with 9 lighting zones and 4 color modes. Light up each zone with its own color, transition between colors, and even adjust the color gradient based on your system usage and temperature.\r\n\r\n\r\nDisplay:\r\n15.6″ (39.6 cm ) diagonal FHD IPS anti-glare WLED-backlit (1920 x 1080)\r\n\r\n\r\n\r\n\r\nProcessor:\r\nChipset:\r\n7th Generation Intel i7 Processor -Intel® Core  i7-7700HQ (2.8 GHz base frequency, up to 3.8 GHz with Intel® Turbo Boost Technology, 6 MB cache, 4 cores) ChipsetIntel® HM175\r\n\r\n\r\nHard Drive & Optical Drive\r\n\r\nStandard Hard Drive:Standard Optical Drive:\r\n\r\n 256 GB PCIe® NVMe™ M.2 SSD + 1TB 7200RPM Hard Drive \r\nNone\r\nExternal Optical Drives Available\r\n\r\n\r\n\r\n\r\nGraphics Controller:\r\nNVIDIA® GeForce® GTX 1050 Ti (4 GB GDDR5 dedicated)\r\n\r\n\r\n\r\n\r\nStandard Memory:\r\nNumber of SODIMMS:\r\n16 GB DDR4-2400 SDRAM (2 x 8 GB)\r\n\r\n\r\n\r\n\r\nAudio Features:\r\nBang & Olufsen; HP Audio Boost; Dual speakers\r\n\r\n\r\n\r\n\r\nNetwork / Communication:\r\nNetwork interface\r\nIntegrated 10/100/1000 GbE LAN\r\nWireless\r\nIntel® 802.11b/g/n/ac (2×2) Wi-Fi® and Bluetooth® 4.2 Combo\r\n\r\n\r\nSlots / Interface\r\n\r\nCard Reader:Input / Output Ports:\r\n1 USB 3.1 Type-C™ (Data Transfer up to 5 Gb/s, DP1.2, HP Sleep and Charge)\r\n3 USB 3.1 Gen 1 (1 HP Sleep and Charge)\r\n1 HDMI\r\n1 RJ-45\r\n1 headphone/microphone combo\r\n1 microphone-in\r\n            Expansion slots\r\n1 multi-format SD media card reader\r\n\r\n\r\nPower System\r\n\r\nBattery:\r\nPower supply type\r\n150 W AC power adapter\r\nBattery type\r\n4-cell, 70 Wh Li-ion\r\nSupports battery fast charge: approximately 90% in 90 minutes\r\n\r\nBattery life\r\nUp to 11 hours and 30 minutes 3 \r\nMaximum Battery Life Video Playback\r\nUp to 8 hours and 15 minutes 3 \r\nEnergy efficiency\r\nENERGY STAR® certified\r\nEPEAT® Silver registered\r\n\r\n\r\nCooling\r\n\r\nStandard Cooling:\r\nOptional Cooling:\r\nCopper CPU Heatsink\r\nIC Diamond Thermal Compound\r\n\r\n\r\n\r\n\r\nSize:\r\nWei